import React from 'react';

import  {Footer,Blog,Possibility,Features,WhatGPT3,Header} from './containers';
import  {CTA,Brand,Navbar} from './components';

const App = () => {
  return (
    <><h1>Blooper</h1><div className="App">
      <div className="gradient_bg">
        <Navbar />
        <Header />
      </div>
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
      <CTA />
      <Blog />
      <Footer />
    </div></>
  )
}

export default App;
